import{clearMsg}from"../../../../../../core/utils/dom/messages.js";export function setActiveTab({evt:e,msgElement:t}){clearMsg({container:t});const a=document.getElementById("tab-container").querySelectorAll('[id$="-tab"]');Array.from(a).forEach((t=>{t.id===e.target.id?(t.dataset.active=!0,t.nextElementSibling.classList.add("w3-blue-grey")):(t.dataset.active=!1,t.nextElementSibling.classList.remove("w3-blue-grey"))}))}